import React from "react";

const NewTodo = () => {
  const todoSubmitHandler = () => {};

  return (
    <form onSubmit={todoSubmitHandler}>
      <div>
        <label htmlFor="new-todo">Todo text</label>
        <input type="text" id="new-todo" />
      </div>
      <button type="submit">Add todo</button>
    </form>
  );
};

export default NewTodo;
